import { FC } from 'react';
import styles from './CountryItem.module.css';

type Props = {
    name: string;
    population: number;
    region: string;
    capital: string;
    flag: string;
};

const CountryItem: FC<Props> = ({
    name,
    population,
    region,
    capital,
    flag,
}) => {
    return (
        <div className={styles.country}>
            <img src={flag} alt="flag" />
            <h2>{name}</h2>
            <p>Population:{population}</p>
            <p>Region:{region}</p>
            <p>Capital:{capital}</p>
        </div>
    );
};

export default CountryItem;
